import React from "react";

import "./styles.css";

const ImgIntro = ({ src, logo }) => {
  return (
    <div className="img-container">
      <img src={src} alt="Avatar" className="image" />
      <div className="middle">
        <img src={logo} alt="Avatar" />
      </div>
    </div>
  );
};

export default ImgIntro;
